import React from "react";
import Chart from "../Chart/Chart";

const ExpenseChart = (props) => {
  const chartDatapoints = [
    { lebel: "Jan", value: 0 },
    { lebel: "Feb", value: 0 },
    { lebel: "Mar", value: 0 },
    { lebel: "Apr", value: 0 },
    { lebel: "May", value: 0 },
    { lebel: "Jun", value: 0 },
    { lebel: "Jul", value: 0 },
    { lebel: "Aug", value: 0 },
    { lebel: "Sep", value: 0 },
    { lebel: "Oct", value: 0 },
    { lebel: "Nov", value: 0 },
    { lebel: "Dec", value: 0 },
  ];

  for (const expense in props.expenses) {
    const expenseMonth = expense.date.getMonth(); // pocinje sa nulom, Jan -> 0
  }

  return <Chart />;
};

export default ExpenseChart;
